  - name: TEXT4000
    number: '6'
    value: 'AMENDMENT DESCRIPTION: A contribution previously reported as unitemized
      is now itemized-records were merged for certain individuals who had duplicate
      records. Corrected the reporting of a receipt from Friends of Dave Weldon and
      moved it from Sch A Ln 11c to Sch A Ln 12 as a transfer. Transfers received
      from the Republican National Committee were used for Party administrative and
      overhead expenses. Payments reported on Sch B Ln 30b for FEA: audio/video-gotv,
      FEA: direct mail-voter reg and FEA: walk map printing-gotv all represent generic
      campaign activity and dont promote, attack, support or oppose any specifically
      identified Federal candidate. Payments to the original vendors for all reimbursements
      to individuals reported on Sch B with ITEMIZE in the purpose field are not reported
      by memo entry because they dont aggregate $200 or more in the calendar year.
      All payments on Sch H4 Ln 21a for audio/visual equipment were for generic use
      of the Committee. None of these expenditures were for a communication that referred
      to a clearly identified candidate for Federal office or that promoted, supported,
      attacked or opposed any such candidate for Federal office. The negative disbursement
      from the John McCain 2008 represents a reimbursement of expenses for use of
      copy machine, cleaning and cable expense utilized by representatives of the
      John McCain campaign. These operating expenses of the Committee were all paid
      by the Committee as administrative allocated activity, and therefore the reimbursement
      is recorded as such. The expenditures reported on Sch H4 to individuals for
      rent are not reimbursements to any individuals. These payments represent rent
      income to these individuals. The warning message for the missing city, state
      and zip for the payment to Perfect TablePlan on Schedule H4 is because this
      is a foreign address. The complete address is reported on the mailing address
      line. All disbursements for salaries and benefits disclosed on Schedule H4 are
      for employees who did not spend more than 25% of their compensated time during
      the reporting period on Federal election activities or activities in connection
      with a Federal election. The Committee uses the Escrow option for receipt of
      corporate in-kind donations as provided for by the Commission in Advisory Opinion
      1992-33. The method ensures that prohibited sources are not used to fund the
      federal share of allocable activity expenses. In-kind details and the escrow
      account activity are summarized as follows: Administrative Escrow acct and In-kinds:
      7/1/08 balance in Administrative escrow account of $28,039.41 (revised balance
      due to increase of $23,360.07 as reflected on Miscellaneous Report to FEC filed
      on 8/11/08). 7/9/08 Yuma Solutions in-kind of $5,000 as reflected on Sch H4
      and transfer on Sch H3 using $1,400 of escrow balance. 7/31/08 Island Lincoln
      Mercury in-kind of $1,614 as reflected on Sch H4 and transfer on Sch H3 using
      $451.92 of escrow balance. 7/31/08 transfer from Admin escrow account back to
      Federal account of $12,000 as reflected on Sch H4. 7/31/08 balance in Admin
      escrow acct of $14,187.49. MD-08 Escrow account and In-kinds: 7/1/08 balance
      in MD-08 escrow account is $78,062.26 (revised balance due to increase of $73,695.93
      as reflected on Miscellaneous Report to FEC filed on 8/11/08). 7/24/08 FX Blue
      Holdings in-kind of $2,094.19 as reflected on Sch H4 and transfer on Sch H3
      using $167.54 of escrow balance. 7/25/08 Florida Medical Association PAC in-kind
      of $1,800 as reflected on Sch H4 and transfer on Sch H3 using $144 of escrow
      balance. 7/29/08 Crystal Beach Development in-kind of $2,000 as reflected on
      Sch H4 and transfer on Sch H3 using $160 of escrow balance.'
